  \"2016-07-27T23:01:42.719365\",\n\t\"name\": \"population-structure-and-productivity-of-whistling-swans-on-the-yukon-kuskokwim-delta-alas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Observations on the Yukon - Delta whistling
  swan population were recorded for the nine year period 1963 to 1971 (Lensink, 1973).
  Data recorded here, collected during the eight year period l972 to 1979, show a
  continuing productive population with the average survival of 70 percent of the
  young to fledging. The effects of the spring climate on the timing of snow melt
  affects nesting distribution by restricting nesting efforts in coastal meadows in
  years when snow melt is delayed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
